    false,nt"url": null,nt"notes": "The USGS NAIP Imagery service from The
    National Map (TNM) consists of high resolution images that combine the visual attributes
    of an aerial photograph with the spatial accuracy and reliability of a map. Resolution
    of National Agriculture Imagery Program (NAIP) data is 1 meter, which means that
    every pixel in the digital orthoimage covers a one meter square of the earthu00e2u0080u0099s
    surface. Many states contribute orthoimagery to The National Map, and USGS relies
    on a partnership with the U.S. Department of Agricultureu00e2u0080u0099s Farm Service
    Agency for NAIP data. The USGS NAIP Imagery service is a mosaic of 1 meter resolution
    natural color and color infrared aerial imagery, containing NAIP and other imagery
    sources to complete the mosaic. The National Map viewer allows free downloads of
    public domain, 1-meter resolution compressed orthoimagery in JPEG 2000 (.jp2) format
    for the conterminous United States, with many urban areas and other locations at
    1-foot (or better) resolution, also in JPEG 2000 (.jp2) format. For additional information
    on orthoimagery, go to http://nationalmap.gov/ortho.html",nt"license_title":
